// ============================================================================
// Helper Functions
// ============================================================================

/**
 * Get colors that match a specific trait, sorted by score
 * @param trait - The trait to search for
 * @param limit - Optional limit on number of results
 */
export function getColorsByTrait(trait: Trait, limit?: number): ColorTraitEntry[] {
  const colors = TRAIT_INDEX[trait] || [];
  return limit ? colors.slice(0, limit) : colors;
}

/**
 * Get colors that match a specific facet, sorted by score
 * @param facet - The facet to search for
 * @param limit - Optional limit on number of results
 */
export function getColorsByFacet(facet: Facet, limit?: number): ColorTraitEntry[] {
  const colors = FACET_INDEX[facet] || [];
  return limit ? colors.slice(0, limit) : colors;
}

/**
 * Get colors that match a specific dimension, sorted by score
 * @param dimension - The dimension to search for
 * @param limit - Optional limit on number of results
 */
export function getColorsByDimension(dimension: Dimension, limit?: number): ColorTraitEntry[] {
  const colors = DIMENSION_INDEX[dimension] || [];
  return limit ? colors.slice(0, limit) : colors;
}

/**
 * Get the top N colors for a trait
 */
export function getTopColorsForTrait(trait: Trait, n: number = 5): ColorTraitEntry[] {
  return getColorsByTrait(trait, n);
}

/**
 * Get the top N colors for a facet
 */
export function getTopColorsForFacet(facet: Facet, n: number = 5): ColorTraitEntry[] {
  return getColorsByFacet(facet, n);
}

/**
 * Get the top N colors for a dimension
 */
export function getTopColorsForDimension(dimension: Dimension, n: number = 5): ColorTraitEntry[] {
  return getColorsByDimension(dimension, n);
}

/**
 * Find colors that match multiple traits (intersection)
 * Returns colors sorted by combined score
 */
export function getColorsByTraits(traits: Trait[]): ColorTraitEntry[] {
  if (traits.length === 0) return [];

  // Get color IDs that appear in ALL trait indexes
  const colorScores = new Map<string, { total: number; count: number; color: ColorTraitEntry }>();

  for (const trait of traits) {
    const colors = TRAIT_INDEX[trait] || [];
    for (const color of colors) {
      const existing = colorScores.get(color.colorId);
      if (existing) {
        existing.total += color.score;
        existing.count += 1;
      } else {
        colorScores.set(color.colorId, {
          total: color.score,
          count: 1,
          color
        });
      }
    }
  }

  // Filter to colors that match ALL traits and sort by combined score
  return Array.from(colorScores.values())
    .filter(entry => entry.count === traits.length)
    .sort((a, b) => b.total - a.total)
    .map(entry => ({
      ...entry.color,
      score: Math.round(entry.total * 100) / 100,
    }));
}
